(53, '\'ሰው መሆን ዕዳ ነው\" እና \"አንተ ማን ነህ? አሉኝ \'', 'ደጀኔ ታደሰ', '4 ደቂቃ', '', 0.00, 'የደጀኔ ታደሰ ግጥሞች፡ <b>\"ሰው መሆን እዳ ነው\"</b> እና <b>\"አንተ ማን ነህ? አሉኝ\"</b>\r\nየማጀቢያ ሙዚቃ፡ ኃይሉ መርጊያ (ዋሊያ ባንድ)<br/><br/>\r\n\r\n<b>\"Sew Mehon Eda New\"</b> and <b>\"Ante Man Neh Alugn?\"</b> (Poem) - Dejene Tadesse <br/>\r\nBackground Music: Hailu Mergia<br/><br/>\r\n\r\n#mahberesebawiyan #sebawiyan #ethiopia #poem #dejene #sew', NULL, 'https://youtu.be/vqR7tdGCPjE', 1, 1, NULL, 0, NULL, 0, 'images/c/1633700157.jpg', 'images/c/thumb/1633700157.jpg', 1, 1, 2, 1, '2021-10-08 22:35:58', '2021-10-19 20:21:46', NULL, 2),
