(78, 'የፍጥረተ ህቡአት መጽሐፍ', 'ማስታወቂያ', '1 ደቂቃ', '', 0.00, '<p>በጤንነት ሰጠኝ /ወልደ ሩፋኤል/<br/>\r\nየተዘጋጀው አዲስ መጽሐፍ <br/>\r\n<b>\"መጽሐፈ ፍጥረተ ህቡአት\" - መጽሐፍ 1</b><br/>\r\nበገበያ ላይ ዋለ!\r\n</p>\r\n<p>\r\n<u><b>መጽሐፉን ለማግኘት</b></u><br/>\r\n\r\n<ol>\r\n<li><b> አድሜሽ የመጽሐፍት ንግድ ሥራ</b><br/><i>\r\n  መስቀል ፍላወር፣ በቀበሌ 35 መዝናኛ በኩል ገባ ብሎ<br/>\r\n  ስልክ፡ 0911448945</i>\r\n</li>\r\n\r\n<li><b> መዛግብት ኔት</b><br/><i>\r\n  ሳርቤት አደባባይ፣ ከሬንቦ መኪና ኪራይ ጀርባ<br/>\r\n  ስልክ፡ 0911616155</i>\r\n</li>\r\n\r\n<li><b> መታሰቢያ ዓለሙ</b><br/><i>\r\n  መገናኛ አደባባይ አካባቢ<br/>\r\n  ስልክ፡ 0938813594</i>\r\n</li>\r\n</ol>\r\n</p>\r\n<p>\r\n<u><b>በአማዞን (On Amazon)</b></u><br/>\r\n\r\n<ol>\r\n\r\n<li><b>   🇪🇹 በአማርኛ ትርጉም</b><br/>\r\n\r\n<ul>\r\n<li>\r\n<b>👇Amazon Kindle Edition</b><br/>\r\n<a href=\"https://www.amazon.com/dp/B09HSL2MF7/\" target=\"_blank\">https://www.amazon.com/dp/B09HSL2MF7/</a>\r\n</li>\r\n<li>\r\n<b>👇Paperback Edition</b><br/>\r\n<a href=\"https://www.amazon.com/dp/B09HJ4GTLF/\" target=\"_blank\">https://www.amazon.com/dp/B09HJ4GTLF/</a>\r\n<br/><br/></li>\r\n</ul>\r\n</li>\r\n\r\n\r\n\r\n<li><b>   🇺🇸 English Translation</b><br/>\r\n\r\n<ul>\r\n<li>\r\n<b>👇Amazon Kindle Edition</b><br/>\r\n<a href=\"https://www.amazon.com/Book-Fitrete-Hebuat-Gateway-Everything-ebook/dp/B09KV7YPL1/\" target=\"_blank\">https://www.amazon.com/Book-Fitrete-Hebuat-Gateway-Everything-ebook/dp/B09KV7YPL1/</a>\r\n</li>\r\n<li>\r\n<b>👇Paperback Edition</b><br/>\r\n<a href=\"https://www.amazon.com/Book-Fitrete-Hebuat-Gateway-Everything/dp/B09KN4HGWC/\"  target=\"_blank\">https://www.amazon.com/Book-Fitrete-Hebuat-Gateway-Everything/dp/B09KN4HGWC/</a>\r\n<br/><br/></li>\r\n</ul>\r\n\r\n</ol>\r\n</p>', NULL, NULL, 1, 1, NULL, 0, NULL, 0, 'images/c/1636279554.jpg', 'images/c/thumb/1636279554.jpg', 1, 1, 2, 1, '2021-11-07 20:05:55', '2021-11-08 11:38:24', NULL, 1),
