(82, '\'ሰው መሆን ከበደው\' — (ግጥም)', 'ብሩክ ገብረ ሚካኤል', '3 ደቂቃ', '', 0.00, 'ብሩክ ገብረሚካኤል ግጥም፡ \"ሰው መሆን ከበደው\" | ሚያዝያ 2013 ዓ.ም. \r\n\r\nስዕል፡ ኤፍራታ አሸብር\r\n\r\n<p>Sew Mehon Kebedew (Poem) - Biruk Gebre Michael | April 2021<br/>\r\nDrawing: Ephrata Ashebir<br/>\r\n</p>\r\n<p>\r\n#mahberesebawiyan #sebawiyan #ethiopia #poem #biruk\r\n</p>\r\n\r\n<p>\r\n<a href=\"https://maseb.org\" target=\"_blank\">MaSeb.org</a>\r\n</p>', NULL, 'https://youtu.be/Fod8oWcIE10', 1, 1, NULL, 0, NULL, 0, 'images/c/1637051322.jpg', 'images/c/thumb/1637051322.jpg', 1, 1, 2, 1, '2021-11-16 18:28:43', '2021-11-16 18:28:43', NULL, 2),
