(86, 'የጥበብ ዋጋው ምን ያህል ነው? እኛስ እንዴት አየነው? በዓለም አቀፍስ ያለው ሁኔታ ምን ይመስላል?', 'አብይ ፋንታዬ', '16 ደቂቃ', '', 0.00, '<p>\r\n<i>‹‹ጥበበኞችን ማንሳት የጥበብ መሠረት የሆነችውን ኢትዮጲያን ማንሳት ነው›› </i>በሚል ርዕስ በማኅበረ ሰብዓዊያን አዘጋጅነት  የተሰናዳው ልዩ ጥበባዊ ዝግጅት ኅዳር 13 ቀን 2014 ዓ.ም. በኢትዮጵያ ብሔራዊ ቲያትር መድረክ ተከናወነ፡፡\r\n</p>\r\n\r\n<p>\r\nበዝግጅቱ ላይ የማኅበረ ሰብዓዊያን መሥራች፣ የቦርድ ሰብሳቢ  እና የማዕከለ ሰብዕ ጥበባት ተመራማሪ የሆኑት አቶ ጤንነት ሰጠኝ እንዲሁም የአፈር ሳይንስ ባለሙያ የሆኑትና በአሃዱ ሬዲዮ እና በፋና ኤፍ ኤም ከሦስት ዓመታት በላይ ሲቀርብ በነበረው ጥበባዊ የመልክዓ ሃሳብ የሬዲዮ ፕሮግራም ላይ የሳይንስ ሃሳቦችን ተንታኝ አቶ አብይ ፋንታዬ ሃሳባቸውን ለታዳሚያን አቅርበዋል፡፡ \r\n</p>\r\n<p>\r\nበማኅበራዊ ስነ-ምግባራዊ ስብዕና እና በሥራ ባህል ግንባታ ላይ ሰፊ ጥናትና  ምርምር ያደረጉት እንዲሁም በተለያዩ ሁለተኛ ደረጃ እና ከፍተኛ የትምህርት ተቋማት ላይ በፍልስፍና እና በስብዕና ግንባታ ላይ ለወጣቶች  በርካታ ስልጠናዎችን በመስጠት የሚታወቁት ጀንበሩ ኃይሌ (ዶ/ር) ሌላው በዝግጅቱ ላይ ጥናታዊ ፅሁፋቸውን ያቀረቡ እንግዳ ነበሩ፡፡ \r\n</p>\r\n<p>\r\nበዕለቱ ከመድረክ የቀረቡት ሃሳቦች ዋና የማጠንጠኛ ርዕሰ ጉዳይ የማንነት መሠረቶቻችንን  ከተገነባባቸው እና ሀገራዊ ዕሴቶቻችን ከሚንፀባረቅባቸው ቱባ የዕደ ጥበብ ሥራዎች በስተጀርባ ባሉ ጥልቅ ጥበባዊ ጉዳዮች ላይ ያደረገ ነበር፡፡ ከዚህም ባለፈ በጥበብ ሃሳቦችና ሥራዎች ላይ በዓለም አቀፍ ደረጃ እና በአገራችን ውስጥ ያሉ ዕይታዎች  ምን እንደሚመስሉ ሰፊ ማብራሪያዎች ቀርቦባቸዋል፡፡\r\n</p>\r\n<p>\r\nበዕለቱ ከመድረክ እንደተገለፀው የዝግጅቱ ዋና ዓላማ በተለያዩ የጥበብ ዘውጎች እና ዕደ ጥበብ ሥራዎች ላይ ተሰማርተው በጥበባዊ ሥራዎቻቸው ሀገራዊ ዕሴቶችን ለማስተዋወቅና ለማቆየት የደከሙና በተለያዩ የሕይወት ፈተናዎችና ሌሎች ምክንያቶች ከማሕበረሰብ የራቁ ባለሙያዎችን ወደፊት በማምጣት ከወቅቱ ትውልድ ጋር ለማስተሳሰር ያለመ ነው፡፡\r\n</p>\r\n<a href=\"https://www.maseb.org\" target=\"_blank\">MaSeb.org</a>', NULL, NULL, 1, 1, NULL, 0, NULL, 0, 'images/c/1637698387.jpg', 'images/c/thumb/1637698387.jpg', 1, 1, 2, 1, '2021-11-24 05:26:41', '2021-11-24 12:50:32', NULL, 1),
(87, 'ከጥበበኞች ዕቃዎች ጀርባ ያሉ ታላላቅ ሃሳቦች', 'ጤንነት ሰጠኝ', '45 ደቂቃ', '', 0.00, '<p>\r\n<i>‹‹ጥበበኞችን ማንሳት የጥበብ መሠረት የሆነችውን ኢትዮጲያን ማንሳት ነው›› </i>በሚል ርዕስ በማኅበረ ሰብዓዊያን አዘጋጅነት  የተሰናዳው ልዩ ጥበባዊ ዝግጅት ኅዳር 13 ቀን 2014 ዓ.ም. በኢትዮጵያ ብሔራዊ ቲያትር መድረክ ተከናወነ፡፡\r\n</p>\r\n\r\n<p>\r\nበዝግጅቱ ላይ የማኅበረ ሰብዓዊያን መሥራች፣ የቦርድ ሰብሳቢ  እና የማዕከለ ሰብዕ ጥበባት ተመራማሪ የሆኑት አቶ ጤንነት ሰጠኝ እንዲሁም የአፈር ሳይንስ ባለሙያ የሆኑትና በአሃዱ ሬዲዮ እና በፋና ኤፍ ኤም ከሦስት ዓመታት በላይ ሲቀርብ በነበረው ጥበባዊ የመልክዓ ሃሳብ የሬዲዮ ፕሮግራም ላይ የሳይንስ ሃሳቦችን ተንታኝ አቶ አብይ ፋንታዬ ሃሳባቸውን ለታዳሚያን አቅርበዋል፡፡ \r\n</p>\r\n<p>\r\nበማኅበራዊ ስነ-ምግባራዊ ስብዕና እና በሥራ ባህል ግንባታ ላይ ሰፊ ጥናትና  ምርምር ያደረጉት እንዲሁም በተለያዩ ሁለተኛ ደረጃ እና ከፍተኛ የትምህርት ተቋማት ላይ በፍልስፍና እና በስብዕና ግንባታ ላይ ለወጣቶች  በርካታ ስልጠናዎችን በመስጠት የሚታወቁት ጀንበሩ ኃይሌ (ዶ/ር) ሌላው በዝግጅቱ ላይ ጥናታዊ ፅሁፋቸውን ያቀረቡ እንግዳ ነበሩ፡፡ \r\n</p>\r\n<p>\r\nበዕለቱ ከመድረክ የቀረቡት ሃሳቦች ዋና የማጠንጠኛ ርዕሰ ጉዳይ የማንነት መሠረቶቻችንን  ከተገነባባቸው እና ሀገራዊ ዕሴቶቻችን ከሚንፀባረቅባቸው ቱባ የዕደ ጥበብ ሥራዎች በስተጀርባ ባሉ ጥልቅ ጥበባዊ ጉዳዮች ላይ ያደረገ ነበር፡፡ ከዚህም ባለፈ በጥበብ ሃሳቦችና ሥራዎች ላይ በዓለም አቀፍ ደረጃ እና በአገራችን ውስጥ ያሉ ዕይታዎች  ምን እንደሚመስሉ ሰፊ ማብራሪያዎች ቀርቦባቸዋል፡፡\r\n</p>\r\n<p>\r\nበዕለቱ ከመድረክ እንደተገለፀው የዝግጅቱ ዋና ዓላማ በተለያዩ የጥበብ ዘውጎች እና ዕደ ጥበብ ሥራዎች ላይ ተሰማርተው በጥበባዊ ሥራዎቻቸው ሀገራዊ ዕሴቶችን ለማስተዋወቅና ለማቆየት የደከሙና በተለያዩ የሕይወት ፈተናዎችና ሌሎች ምክንያቶች ከማሕበረሰብ የራቁ ባለሙያዎችን ወደፊት በማምጣት ከወቅቱ ትውልድ ጋር ለማስተሳሰር ያለመ ነው፡፡\r\n</p>\r\n<a href=\"https://www.maseb.org\" target=\"_blank\">MaSeb.org</a>', NULL, NULL, 1, 1, NULL, 0, NULL, 0, 'images/c/1637698400.jpg', 'images/c/thumb/1637698400.jpg', 1, 1, 2, 1, '2021-11-24 05:32:12', '2021-11-25 01:26:03', NULL, 1),
(88, 'የጤንነት ሰጠኝ /ወልደ ሩፋኤል/ መጽሐፍ', 'መጽሐፈ አድሜስ /Book of Addmes/', '2 ደቂቃ', '', 0.00, '<p><strong>መጽሐፈ ምልአ ውህደት /መጽሐፍ 1/ ፣ መጽሐፈ ፍጥረተ ህቡአት /መጽሐፍ 1/ እና ንግርተ ካህዝን /መጽሐፍ 1/ በሃገር ውስጥ ለማግኘት:</strong></p>\r\n\r\n\r\n\r\n<p>1/ አድሜሽ የመጽሐፍት ንግድ ሥራ<br>መስቀል ፍላወር፣ በቀበሌ 35 መዝናኛ በኩል ገባ ብሎ<br>ስልክ፡ 0911448945</p>\r\n\r\n\r\n\r\n<p>2/ መዛግብት ኔት<br>ሳርቤት አደባባይ፣ ከሬንቦ መኪና ኪራይ ጀርባ<br>ስልክ፡ 0911616155</p>\r\n\r\n\r\n\r\n<p>3/ መታሰቢያ ዓለሙ<br>መገናኛ አደባባይ አካባቢ<br>ስልክ፡ 0938813594</p>\r\n\r\n\r\n\r\n<p>4/ ዕደ ሰብዓዊያን ጥበብ<br>ቦሌ አትላስ አካባቢ፣ ከፕሬዝደንሻል ሆቴል ፊትለፊት<br>ስልክ፡ 0991 191057 / 0910 623809</p>\r\n\r\n\r\n\r\n<p>5/ አዲስ ይትባረክ ወይም ያሬድ ይታገሱ<br>ቃሊቲና አቃቂ አካባቢ<br>ስልክ፡ 0963 153939 / 0954 908193 / 0911 413411</p>\r\n\r\n\r\n\r\n<p>6/ ያሬድ የወንዶች የውበት ሳሎን<br>ሰሜን ማዘጋጃ አካባቢ፣ ፖላንድ ኤምባሲ አጠገብ ታደሰ ህንፃ<br>ስልክ፡ 0912 031858</p>\r\n\r\n\r\n\r\n<p><strong>ወደ ክፍለሃገራት የሚላክ ለማዘዝ:</strong></p>\r\n\r\n\r\n\r\n<p><strong>መዛግብት ኔት</strong><br>ሳርቤት አደባባይ፣ ከሬንቦ መኪና ኪራይ ጀርባ<br>ስልክ፡ 0911616155</p>\r\n\r\n\r\n\r\n<p><strong>የደራሲውን የአማዞን ገፅ ለመከተል:</strong> <a href=\"https://www.amazon.com/~/e/B09HTJRZNC\" target=\"_blank\">https://www.amazon.com/~/e/B09HTJRZNC</a></p>\r\n\r\n\r\n\r\n<p><strong>ሁሉንም መጽሐፍት ኦንላይን ለማግኘት:</strong></p>\r\n\r\n\r\n\r\n<p><strong>መጽሐፈ ምልአ ውህደት /መጽሐፍ 1/</strong><br>መዛግብት ኔት፡ <a href=\"https://mezagebtnet.com/product/the-book-of-alchemy-metshafe-melea-wuhdet-1/\" target=\"_blank\">https://mezagebtnet.com/product/the-book-of-alchemy-metshafe-melea-wuhdet-1/</a><br>አማዞን ኪንድል (አማርኛ): <a href=\"https://www.amazon.com/dp/B08F3LLKYK/<br>አማዞን ኪንድል (እንግሊዘኛ): https://www.amazon.com/gp/product/B09FKF9XMR\" target=\"_blank\">https://www.amazon.com/dp/B08F3LLKYK/<br>አማዞን ኪንድል (እንግሊዘኛ): https://www.amazon.com/gp/product/B09FKF9XMR</a></p>\r\n\r\n\r\n\r\n<p><strong>መጽሐፈ ፍጥረተ ህቡአት /መጽሐፍ 1/</strong><br>መዛግብት ኔት፡ <a href=\"https://mezagebtnet.com/product/fitere-hebuat-1/\" target=\"_blank\">https://mezagebtnet.com/product/fitere-hebuat-1/</a><br>አማዞን ኪንድል (በእንግሊዝኛ): <a href=\"https://www.amazon.com/dp/B07DXLWMW9\" target=\"_blank\">https://www.amazon.com/dp/B07DXLWMW9</a><br>አማዞን ፔፐር ባክ (በእንግሊዝኛ): <a href=\"https://www.amazon.com/dp/172164976X/\" target=\"_blank\">https://www.amazon.com/dp/172164976X/</a><br>አማዞን ፔፐር ባክ (በአማርኛ): <a href=\"https://www.amazon.com/dp/1720765294/\" target=\"_blank\">https://www.amazon.com/dp/1720765294/</a></p>\r\n\r\n\r\n\r\n<p><strong>ንግርተ ካህዝን /መጽሐፍ 1/</strong><br>መዛግብት ኔት፡ <a href=\"https://mezagebtnet.com/product/myth-of-kazhn-1/\" target=\"_blank\">https://mezagebtnet.com/product/myth-of-kazhn-1/</a><br>አማዞን ኪንድል (በአማርኛ): <a href=\"https://www.amazon.com/dp/B09KPXRRH6\" target=\"_blank\">https://www.amazon.com/dp/B09KPXRRH6</a><br>አማዞን ፔፐር ባክ (በአማርኛ): <a href=\"https://www.amazon.com/መጽሐፈ-ንግርተ-ካህዝን-Reach-Afrikaans/dp/B09KNCYNXX/\" target=\"_blank\">https://www.amazon.com/መጽሐፈ-ንግርተ-ካህዝን-Reach-Afrikaans/dp/B09KNCYNXX/</a><br>አማዞን ኪንድል (በእንግሊዝኛ): <a href=\"https://www.amazon.com/dp/B09M3XHXTH\" target=\"_blank\">https://www.amazon.com/dp/B09M3XHXTH</a><br>አማዞን ፔፐር ባክ (እንግሊዘኛ): <a href=\"https://www.amazon.com/dp/B09M129CKW/\" target=\"_blank\">https://www.amazon.com/dp/B09M129CKW/</a></p>\r\n\r\n\r\n\r\n<p><strong>መጽሐፈ ጥበብ /መጽሐፍ 1/</strong><br>አማዞን ኪንድል (በአማርኛ): <a href=\"https://www.amazon.com/dp/B09MDCGRDB\" target=\"_blank\">https://www.amazon.com/dp/B09MDCGRDB</a></p>', NULL, 'https://youtu.be/8fJ6CuBjE1A', 1, 1, NULL, 0, NULL, 0, 'images/c/1638099298.jpg', 'images/c/thumb/1638099298.jpg', 1, 1, 2, 1, '2021-11-28 21:34:59', '2021-11-28 21:43:54', NULL, 1),
