(92, '\'ስምንተኛው ቅኝት\' — (ግጥም)', 'ብሩክ ገብረ ሚካኤል', '6 ደቂቃ', '', 0.00, '<p>የብሩክ ገብረሚካኤል ግጥም፡ “ስምንተኛው ቅኝት”</p>\r\n\r\n\r\n\r\n<p>ስዕል – ኤፍራታ አሸብር<br>የማጀቢያ ሙዚቃ፡ እጅጋየሁ ሽባባው (ጂጂ)</p>\r\n\r\n\r\n\r\n<p>Sementegnaw Qegnit (Poem) – Biruk Gebre Michael<br>Background Music: Ejigayehu Shibabaw (GiGi)</p>\r\n\r\n\r\n\r\n<p>mahberesebawiyan #sebawiyan #ethiopia #poem #biruk</p>\r\n\r\n\r\n\r\n<p><a href=\"https://MaSeb.org\">MaSeb.org</a></p>', NULL, 'https://youtu.be/KeuBvLYauXI', 1, 1, NULL, 0, NULL, 0, 'images/c/1638361656.jpg', 'images/c/thumb/1638361656.jpg', 1, 1, 2, 1, '2021-12-01 22:27:36', '2021-12-04 11:50:36', NULL, 2),
