(104, '\'ፀሐይ  ደመቀች\'', 'የልጆች የፓፔት ትርዒት በኤረር ተራራ', '3 ደቂቃ', '', 0.00, '<p><strong>የልጆች የፓፔት /አሻንጉሊት/ ትዕይንት በኤረር ተራራ</strong></p>\r\n\r\n<p>\r\n👉 በዚህ የልጆች ቪድዮ ላይ የተሳተፉት ሦስቱ አሻንጉሊቶች አንበሳ፣ ወፍ እና ሰስ ናቸው።<br/>\r\n👉 ሙሉ ቀረፃው የተደረገው ከአዲስ አበባ በ40 ኪ.ሜ. ላይ በሚገኘው በኤረር ተራራ ጫካ ውስጥ ነው።\r\n</p>\r\n<p>\r\nሙዚቃ፦ “ፀሐዬ ደመቀች”\r\n</p>\r\n<p>\r\nታህሳስ 2014 ዓ.ም.\r\n</p>\r\n<p>\r\nማኅበረ ሰብዓዊያን\r\n<a href=\"https://maseb.org\" target=\"_blank\">MaSeb.org</a>\r\n</p>', NULL, 'https://youtu.be/kUtt_ZiB0JA', 1, 1, NULL, 0, NULL, 0, 'images/c/1640548726.jpg', 'images/c/thumb/1640548726.jpg', 1, 1, 2, 1, '2021-12-27 05:58:47', '2021-12-27 05:58:47', NULL, 2),
