(2, 'ልዩ ልዩ ቪድዮዎች ስብስብ', 'Special Video Collection', 'collection', '', 'images/c/banner_collections.jpg', 'images/c/gize_logo.png', 0, 1, 'በዚህ ቻናል የተለያዩ ቪድዮዎች ለደንበኞቻችን እናቀርባለን። ቪድዮዎቹ በዓይነት የተለያዩ ሆነው እንደ ግጥም፣ አጫጭር ትረካዎች እና ሌሎች ዓይነት ይዘት ይኖራቸዋል፡፡', 'Mezagebt Net Office. Addis Ababa, Ethiopia', '(+251) 911 616155 | (+251) 911 922487', 'https://gize.mezagebtnet.com', '2021-09-29 16:49:33', '2021-09-29 16:49:33', NULL);
